import React from 'react';
import {List} from "../../components/compensations/list";
import {ItemList} from "../../components/compensations/itemList";
import './styles.css'
import {Avatar} from "../../components/main/avatar";

async function getCompensations() {
    let data = await (await fetch('http://127.0.0.1:8000/api/compensations/?category_url=standard')).json();
    console.log(data.compensations);
    let compensationsItems = data.compensations.map((compensation, index) =>
        (<ItemList category={this.props.category}
                   id={"drugs"}
                   title={compensation.name}
                   money={compensation.money}
                   documents={compensation.requirements}
                   addInfo={compensation.additional_info}
                   isOnce={compensation.once_a_term}
        />));
    return (
        <div className="Block">
            <List items={compensationsItems}/>
        </div>
    );
}

export class CompensationList extends React.Component {
    constructor(props) {
        super(props);
    }

    // Получение данных для всех ItemList должно приходить через БД из таблицы с этими компенсациями
    render() {
        return getCompensations();

    }
}

CompensationList.propTypes = {
    category: String,
};

CompensationList.defaultProps = {
    category: "default"
};
